DROP TABLE IF EXISTS `gd_admin`;
CREATE TABLE `gd_admin` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL COMMENT '管理员名',
  `realname` varchar(20) NOT NULL COMMENT '真实姓名',
  `role_id` int(11) NOT NULL COMMENT '角色ID',
  `password` varchar(32) NOT NULL COMMENT '密码',
  `status` tinyint(1) NOT NULL COMMENT '状态',
  `count` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '登录次数',
  `last_login_ip` varchar(16) NOT NULL COMMENT '上一次登录ID',
  `create_user` int(11) NOT NULL COMMENT '创建者',
  `update_user` int(11) NOT NULL COMMENT '更新者',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL COMMENT '更新时间',
  `deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除',
  `issystem` tinyint(1) NOT NULL DEFAULT '0' COMMENT '系统',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_area`;
CREATE TABLE `gd_area` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `surname` varchar(10) NOT NULL DEFAULT '' COMMENT '中文名',
  `pid` int(11) NOT NULL,
  `name` varchar(10) NOT NULL COMMENT '区域英文名称',
  `domain` varchar(50) NOT NULL COMMENT '绑定域名',
  `default` tinyint(1) NOT NULL COMMENT '是否是默认区域',
  `create_user` int(11) NOT NULL COMMENT '创建者',
  `update_user` int(11) NOT NULL COMMENT '更新者',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL COMMENT '更新时间',
  `deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除',
  `pctheme` varchar(20) NOT NULL COMMENT 'PC模板',
  `mobiletheme` varchar(20) NOT NULL COMMENT '移动端模板',
  `htmlfolder` varchar(20) NOT NULL COMMENT '模板保护',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_auth_group`;
CREATE TABLE `gd_auth_group` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL COMMENT '权限分组',
  `description` varchar(30) NOT NULL COMMENT '分组描述',
  `create_user` int(11) NOT NULL COMMENT '创建者',
  `create_time` timestamp NOT NULL COMMENT '更新者',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;


DROP TABLE IF EXISTS `gd_auth_rule`;
CREATE TABLE `gd_auth_rule` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL COMMENT '规则名',
  `pid` int(11) NOT NULL COMMENT '父ID',
  `sorting` int(11) NOT NULL COMMENT '排序',
  `controller` varchar(20) NOT NULL COMMENT '控制器名',
  `action` varchar(20) NOT NULL COMMENT 'action',
  `param` varchar(30) NOT NULL COMMENT '参数',
  `create_user` int(11) NOT NULL COMMENT '创建者',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_user` int(11) NOT NULL COMMENT '更新者',
  `update_time` timestamp NOT NULL COMMENT '更新时间',
  `status` tinyint(1) NOT NULL COMMENT '状态',
  `deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除',
  `icon` varchar(20) NOT NULL COMMENT '图标',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=199 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_company`;
CREATE TABLE `gd_company` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `area_id` int(11) NOT NULL COMMENT '区域ID',
  `name` varchar(60) NOT NULL COMMENT '公司名',
  `address` varchar(60) NOT NULL COMMENT '公司地址',
  `postcode` varchar(10) NOT NULL COMMENT '邮政编码',
  `contact` varchar(30) NOT NULL COMMENT '联系方式',
  `mobile` varchar(20) NOT NULL COMMENT '手机号',
  `phone` varchar(30) NOT NULL COMMENT '座机号',
  `fax` varchar(30) NOT NULL COMMENT '传真',
  `email` varchar(30) NOT NULL COMMENT '邮箱',
  `qq` varchar(30) NOT NULL COMMENT 'QQ',
  `license` varchar(30) NOT NULL COMMENT '营业执照',
  `other` varchar(100) NOT NULL COMMENT '其它',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_config`;
CREATE TABLE `gd_config` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL COMMENT '配置名',
  `value` text NOT NULL COMMENT '配置值',
  `description` text NOT NULL COMMENT '描述',
  `deleted` int(3) NOT NULL DEFAULT '0' COMMENT '删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_content`;
CREATE TABLE `gd_content` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `title` varchar(60) NOT NULL COMMENT '标题',
  `area_id` int(11) NOT NULL COMMENT '区域ID',
  `sorts_id` int(11) NOT NULL COMMENT '分类ID',
  `subsort_id` int(11) NOT NULL COMMENT '子分类ID',
  `color` varchar(10) NOT NULL COMMENT '标题颜色',
  `subtitle` varchar(60) NOT NULL COMMENT '子标题',
  `filename` longtext NOT NULL COMMENT '附件',
  `author` varchar(20) NOT NULL COMMENT '作者',
  `source` varchar(20) NOT NULL COMMENT '来源',
  `link` varchar(100) NOT NULL COMMENT '外部链接',
  `date` timestamp NOT NULL COMMENT '定时发布时间',
  `pic` varchar(60) NOT NULL COMMENT '缩略图',
  `pics` text CHARACTER SET utf16 NOT NULL COMMENT '多图',
  `content` longtext NOT NULL COMMENT '内容',
  `tags` text NOT NULL COMMENT '标签',
  `keywords` varchar(100) NOT NULL COMMENT '关键词',
  `description` varchar(200) NOT NULL COMMENT '描述',
  `sorting` bigint(20) NOT NULL COMMENT '排序',
  `top` tinyint(1) NOT NULL COMMENT '置顶',
  `recommend` varchar(10) NOT NULL DEFAULT '' COMMENT '推荐',
  `headline` varchar(10) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '头条',
  `visit` int(10) NOT NULL COMMENT '访问量',
  `like` int(10) NOT NULL COMMENT '点赞量',
  `oppose` int(10) NOT NULL COMMENT '反对量',
  `create_user` int(10) NOT NULL COMMENT '创建者',
  `update_user` int(10) NOT NULL COMMENT '更新者',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL COMMENT '更新时间',
  `otherfile` varchar(100) DEFAULT NULL COMMENT '其它附件',
  `pictitles` text COMMENT '图片对应标题 逗号分隔',
  `status` tinyint(1) NOT NULL COMMENT '状态',
  `deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_content_ext`;
CREATE TABLE `gd_content_ext` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `content_id` bigint(20) NOT NULL COMMENT '关联content表',
  `modelfield_id` int(11) NOT NULL COMMENT '模型扩展字段ID',
  `value` varchar(255) NOT NULL DEFAULT '' COMMENT '模型扩展字段值 多个值以逗号隔开',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_form`;
CREATE TABLE `gd_form` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) DEFAULT NULL,
  `table_name` varchar(30) DEFAULT NULL,
  `create_user` int(11) DEFAULT NULL,
  `update_user` int(11) DEFAULT '0',
  `create_time` timestamp NULL DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  `status` tinyint(1) NOT NULL,
  `deleted` tinyint(1) NOT NULL,
  `issystem` tinyint(1) DEFAULT '0',
  `type` varchar(10) DEFAULT '1',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_form_comment`;
CREATE TABLE `gd_form_comment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `content_id` int(11) DEFAULT NULL COMMENT '内容ID',
  `content` varchar(255) DEFAULT NULL COMMENT '评论内容',
  `pid` int(11) DEFAULT '0' COMMENT '父ID',
  `create_time` datetime DEFAULT NULL,
  `create_user` int(11) DEFAULT NULL,
  `ip` varchar(20) DEFAULT NULL,
  `icon` varchar(50) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL COMMENT '用户ID',
  `nickname` varchar(30) DEFAULT NULL COMMENT '昵称',
  `status` tinyint(1) DEFAULT NULL COMMENT '0：前台不显示；1：前台展示；3：审核中  与form表type关联',
  `deleted` tinyint(1) DEFAULT '0',
  `area_id` int(11) DEFAULT NULL COMMENT '区域ID',
  `checked` int(1) DEFAULT '0',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;


DROP TABLE IF EXISTS `gd_form_field`;
CREATE TABLE `gd_form_field` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `form_id` int(11) DEFAULT NULL,
  `name` longtext,
  `length` bigint(20) DEFAULT NULL,
  `required` tinyint(1) DEFAULT NULL,
  `description` longtext,
  `sorting` bigint(20) DEFAULT NULL,
  `create_user` int(11) DEFAULT NULL,
  `update_user` int(11) DEFAULT NULL,
  `create_time` timestamp NULL DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  `deleted` tinyint(1) unsigned zerofill DEFAULT '0',
  `type` varchar(20) DEFAULT NULL COMMENT 'mysql字段类型',
  `issystem` tinyint(1) unsigned zerofill DEFAULT '0' COMMENT '1:系统内置',
  `display` tinyint(1) unsigned zerofill DEFAULT '1' COMMENT '是否显示在后台列表',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `ay_form_field_sorting` (`sorting`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_form_message`;
CREATE TABLE `gd_form_message` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `area_id` int(11) DEFAULT NULL,
  `username` varchar(10) DEFAULT NULL,
  `mobile` varchar(20) DEFAULT NULL,
  `content` text,
  `pid` int(11) DEFAULT '0',
  `icon` varchar(100) DEFAULT NULL,
  `sex` varchar(10) DEFAULT NULL,
  `ip` varchar(20) DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL,
  `create_user` int(11) DEFAULT NULL,
  `update_user` int(11) DEFAULT NULL,
  `create_time` timestamp NULL DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL,
  `deleted` tinyint(1) DEFAULT '0',
  `checked` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=88 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_label`;
CREATE TABLE `gd_label` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL COMMENT '标签名',
  `value` text NOT NULL COMMENT '标签值',
  `type` varchar(10) NOT NULL COMMENT '标签类型',
  `description` varchar(60) NOT NULL COMMENT '标签描述',
  `create_user` int(11) NOT NULL COMMENT '创建者',
  `update_user` int(11) NOT NULL COMMENT '更新者',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL COMMENT '更新时间',
  `status` tinyint(1) NOT NULL COMMENT '状态',
  `deleted` tinyint(1) NOT NULL COMMENT '删除',
  `content` text NOT NULL COMMENT '标签内容',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_link`;
CREATE TABLE `gd_link` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `area_id` int(11) NOT NULL COMMENT '友情链接ID',
  `group_id` bigint(20) NOT NULL COMMENT '友情链接分组',
  `name` varchar(30) NOT NULL COMMENT '友情链接名',
  `link` varchar(60) NOT NULL COMMENT '链接',
  `logo` varchar(60) NOT NULL COMMENT 'logo',
  `sorting` int(11) NOT NULL COMMENT '排序',
  `status` tinyint(1) NOT NULL COMMENT '状态',
  `create_user` int(11) NOT NULL COMMENT '创建者',
  `update_user` int(11) NOT NULL COMMENT '更新者',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL COMMENT '更新时间',
  `deleted` tinyint(4) NOT NULL DEFAULT '0' COMMENT '删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_link_group`;
CREATE TABLE `gd_link_group` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL COMMENT '友情链接分组名',
  `area_id` int(11) NOT NULL COMMENT '区域ID',
  `create_user` int(11) NOT NULL COMMENT '创建者',
  `update_user` int(11) NOT NULL COMMENT '更新者',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL COMMENT '更新时间',
  `sorting` int(3) NOT NULL COMMENT '排序',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态',
  `deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;


DROP TABLE IF EXISTS `gd_logs`;
CREATE TABLE `gd_logs` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL COMMENT '日志名',
  `description` varchar(100) NOT NULL COMMENT '日志描述',
  `ip` varchar(20) NOT NULL COMMENT 'ip地址',
  `os` varchar(20) NOT NULL COMMENT '操作系统',
  `browser` varchar(20) NOT NULL COMMENT '浏览器',
  `create_user` int(10) NOT NULL COMMENT '创建用户',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `mobile` varchar(30) NOT NULL COMMENT '移动端',
  `deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除标志',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=455 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_menu`;
CREATE TABLE `gd_menu` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `pid` int(11) NOT NULL,
  `name` varchar(30) NOT NULL,
  `area_id` int(11) NOT NULL,
  `controller` varchar(30) NOT NULL COMMENT '控制器',
  `action` varchar(30) NOT NULL COMMENT 'action',
  `params` varchar(60) NOT NULL COMMENT '参数',
  `url` varchar(60) NOT NULL COMMENT 'URL',
  `roles_id` json NOT NULL COMMENT '角色IDS，绑定角色',
  `sorting` int(3) NOT NULL,
  `status` int(1) NOT NULL,
  `shortcut` varchar(15) NOT NULL,
  `icon` varchar(20) NOT NULL,
  `create_user` int(11) NOT NULL,
  `update_user` int(11) NOT NULL,
  `create_time` timestamp NOT NULL,
  `update_time` timestamp NOT NULL,
  `deleted` tinyint(1) NOT NULL,
  `is_fast` tinyint(1) DEFAULT '0' COMMENT '是否首页快捷显示',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=87 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_model`;
CREATE TABLE `gd_model` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL,
  `type` tinyint(1) NOT NULL,
  `urlname` varchar(30) NOT NULL,
  `listtpl` varchar(30) NOT NULL,
  `contenttpl` varchar(30) NOT NULL,
  `status` tinyint(1) NOT NULL,
  `create_user` int(10) NOT NULL,
  `update_user` int(10) NOT NULL,
  `create_time` timestamp NOT NULL,
  `update_time` timestamp NOT NULL,
  `deleted` tinyint(1) NOT NULL,
  `issystem` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_modelfield`;
CREATE TABLE `gd_modelfield` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `model_id` int(11) NOT NULL COMMENT '模型ID',
  `name` varchar(20) NOT NULL COMMENT '字段名',
  `type` varchar(20) NOT NULL COMMENT '类型',
  `value` text NOT NULL COMMENT '值',
  `description` varchar(50) NOT NULL COMMENT '描述',
  `sorting` bigint(20) NOT NULL COMMENT '排序',
  `deleted` tinyint(1) NOT NULL COMMENT '删除',
  `create_user` int(11) NOT NULL COMMENT '创建者',
  `update_user` int(11) NOT NULL COMMENT '更新者',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL COMMENT '更新时间',
  `status` int(11) NOT NULL COMMENT '状态',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_myad`;
CREATE TABLE `gd_myad` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL COMMENT '广告名',
  `label` varchar(50) NOT NULL COMMENT '标签',
  `type` varchar(50) NOT NULL COMMENT '类型',
  `timeset` tinyint(1) NOT NULL COMMENT '开启时间限制',
  `start_time` datetime NOT NULL COMMENT '开始时间',
  `end_time` datetime NOT NULL COMMENT '结束时间',
  `normbody` text NOT NULL,
  `expbody` text NOT NULL,
  `path` text NOT NULL,
  `link` text NOT NULL COMMENT '链接',
  `desc` text NOT NULL COMMENT '描述',
  `width` varchar(10) NOT NULL COMMENT '宽度',
  `height` varchar(10) NOT NULL COMMENT '高度',
  `text_size` varchar(10) NOT NULL COMMENT '字体大小',
  `text_color` varchar(10) NOT NULL COMMENT '字体颜色',
  `text_content` varchar(255) NOT NULL COMMENT '广告内容',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `create_user` int(11) NOT NULL COMMENT '创建者',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `update_user` int(11) NOT NULL COMMENT '更新者',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态',
  `deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=85 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;


DROP TABLE IF EXISTS `gd_role`;
CREATE TABLE `gd_role` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `areas_id` text NOT NULL COMMENT '管辖区域JSON',
  `name` varchar(20) NOT NULL COMMENT '角色名',
  `description` varchar(100) NOT NULL COMMENT '角色描述',
  `rules_id` text NOT NULL COMMENT '权限JSON',
  `create_user` int(11) NOT NULL COMMENT '创建者ID',
  `update_user` int(11) NOT NULL COMMENT '更新者ID',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL COMMENT '更新时间',
  `status` tinyint(1) NOT NULL COMMENT '角色状态',
  `deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除标志',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_site`;
CREATE TABLE `gd_site` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `area_id` int(11) NOT NULL COMMENT '区域ID',
  `title` varchar(100) NOT NULL COMMENT '网站标题',
  `subtitle` varchar(100) NOT NULL COMMENT '网站子标题',
  `domain` varchar(100) NOT NULL COMMENT '网站域名',
  `logo` varchar(60) NOT NULL COMMENT '网站LOGO',
  `keywords` varchar(300) NOT NULL COMMENT '网站关键词',
  `description` varchar(300) NOT NULL COMMENT '网站描述',
  `icp` varchar(50) NOT NULL COMMENT '网站域名备案号',
  `statistics` varchar(500) NOT NULL COMMENT '网站统计信息',
  `copyright` varchar(500) NOT NULL COMMENT '网站版权',
  `qrcode` varchar(100) NOT NULL COMMENT '网站二维码',
  `service_code` varchar(100) NOT NULL COMMENT '服务器号二维码',
  `subscribe_code` varchar(100) NOT NULL COMMENT '订阅号二维码',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_slide`;
CREATE TABLE `gd_slide` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(80) NOT NULL COMMENT '幻灯片名',
  `area_id` int(11) NOT NULL COMMENT '区域ID',
  `group_id` bigint(20) NOT NULL COMMENT '组ID',
  `pic` longtext NOT NULL COMMENT '图片',
  `link` varchar(100) NOT NULL COMMENT '链接',
  `description` varchar(100) NOT NULL COMMENT '描述',
  `sorting` bigint(20) NOT NULL COMMENT '排序',
  `create_user` int(11) NOT NULL COMMENT '创建者',
  `update_user` int(11) NOT NULL COMMENT '更新者',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL COMMENT '更新时间',
  `deleted` tinyint(1) NOT NULL COMMENT '删除',
  `bgcolor` varchar(30) NOT NULL COMMENT '背景颜色',
  `bgpic` varchar(100) NOT NULL COMMENT '背景图',
  `status` int(1) NOT NULL COMMENT '状态',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_slide_group`;
CREATE TABLE `gd_slide_group` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL COMMENT '分组名称',
  `area_id` int(11) NOT NULL COMMENT '区域ID',
  `status` tinyint(1) NOT NULL COMMENT '状态',
  `create_user` int(11) NOT NULL COMMENT '创建者',
  `update_user` int(11) NOT NULL COMMENT '更新者',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL COMMENT '更新时间',
  `deleted` tinyint(1) NOT NULL COMMENT '删除',
  `sorting` int(3) NOT NULL COMMENT '排序',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `id` (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;


DROP TABLE IF EXISTS `gd_sorts`;
CREATE TABLE `gd_sorts` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `area_id` int(3) NOT NULL COMMENT '区域ID',
  `model_id` int(5) NOT NULL COMMENT '模型ID',
  `pid` int(10) NOT NULL COMMENT '父分类ID',
  `name` varchar(30) NOT NULL COMMENT '分类栏目名',
  `listtpl` varchar(50) NOT NULL COMMENT '列表页模板',
  `contenttpl` varchar(50) NOT NULL COMMENT '详情页模板',
  `status` tinyint(1) NOT NULL COMMENT '状态',
  `outlink` varchar(100) NOT NULL COMMENT '外部链接',
  `subname` varchar(100) NOT NULL COMMENT '子标题',
  `pics` text NOT NULL COMMENT '图片集',
  `ico` varchar(100) NOT NULL COMMENT '栏目缩略图',
  `pic` varchar(100) NOT NULL COMMENT '栏目大图',
  `title` varchar(100) NOT NULL COMMENT '栏目SEO标题',
  `keywords` varchar(100) NOT NULL COMMENT '栏目SEO关键词',
  `description` varchar(200) NOT NULL COMMENT '栏目SEO描述',
  `urlname` varchar(20) NOT NULL COMMENT '栏目别名',
  `sorting` bigint(20) NOT NULL DEFAULT '0' COMMENT '排序',
  `create_user` varchar(10) NOT NULL COMMENT '创建者',
  `update_user` bigint(20) NOT NULL COMMENT '更新者',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `deleted` tinyint(1) NOT NULL COMMENT '删除',
  `enname` varchar(20) NOT NULL COMMENT '英文名',
  `slogan` varchar(255) NOT NULL COMMENT '宣传语',
  `content` text NOT NULL COMMENT '栏目内容',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_statistics`;
CREATE TABLE `gd_statistics` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `start_time` datetime NOT NULL COMMENT '访问开始时间',
  `ip` varchar(16) NOT NULL COMMENT 'IP',
  `os` varchar(20) NOT NULL COMMENT '操作系统',
  `browser` varchar(50) NOT NULL COMMENT '浏览器',
  `spider` varchar(30) NOT NULL COMMENT '搜索引擎',
  `content_id` int(11) NOT NULL COMMENT '0:首页',
  `sort_id` int(11) NOT NULL COMMENT '0:首页',
  `from` varchar(20) NOT NULL COMMENT '来源',
  `end_time` datetime NOT NULL COMMENT '结束时间',
  `province` varchar(10) NOT NULL COMMENT '省',
  `query_string` varchar(50) NOT NULL COMMENT '访问query_string',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `id` (`id`) USING BTREE COMMENT '便于插入数据'
) ENGINE=InnoDB AUTO_INCREMENT=7148 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;






DROP TABLE IF EXISTS `gd_tags`;
CREATE TABLE `gd_tags` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `area_id` int(10) NOT NULL COMMENT '绑定区域ID',
  `name` varchar(30) NOT NULL COMMENT '区域名',
  `link` varchar(60) NOT NULL COMMENT '链接',
  `create_user` int(11) NOT NULL COMMENT '创建者ID',
  `update_user` int(11) NOT NULL COMMENT '更新者ID',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NOT NULL COMMENT '更新时间',
  `status` tinyint(1) NOT NULL COMMENT '状态:0:不可用；1：可用',
  `deleted` tinyint(1) NOT NULL COMMENT '删除 0：未删除；1：已删除； 删除操作不进行物理删除',
  `sorting` int(10) NOT NULL COMMENT '排序',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;


DROP TABLE IF EXISTS `gd_test`;
CREATE TABLE `gd_test` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `a` varchar(255) DEFAULT NULL,
  `b` varchar(255) DEFAULT NULL,
  `c` varchar(255) DEFAULT NULL,
  `d` varchar(255) DEFAULT NULL,
  `e` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;


DROP TABLE IF EXISTS `gd_upgrade_manage`;
CREATE TABLE `gd_upgrade_manage` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL COMMENT '版权号',
  `zipfile` varchar(255) NOT NULL COMMENT '更新包',
  `md5` varchar(255) NOT NULL COMMENT '包MD5值',
  `detail` text NOT NULL COMMENT '详细说明文件',
  `fit_versions` varchar(255) NOT NULL COMMENT '适用版本号多个以半角逗号隔开',
  `description` text NOT NULL COMMENT '更新描述',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `start_time` datetime NOT NULL COMMENT '开始时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `status` varchar(255) NOT NULL DEFAULT '0' COMMENT '是否开启更新',
  `deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;


